import logo from './logo.svg';
import './App.css';

const DUMMY_DATA = [
  {
    provider_id : "user",
    utterance : "Hi!"
  },
  {
    provider_id : "chatbot",
    utterance : "Hi! My name is iFetch, how can I help you?"
  }
]

function Message(props) {
  var message = props.message
  return (
    <li key={message.id}>
    <div>
      {message.provider_id}
    </div>
    <div>
      {message.utterance}
    </div>
  </li>
  )
}

function Messages(props) {
  return (
    <ul className="message-list">                 
      {props.messages.map(message => {
        return (
          <Message message={message}/>
        )
      })}
    </ul>
  )
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Messages messages={DUMMY_DATA}></Messages>
      </header>
    </div>
  );
}

export default App;
